import styled from "styled-components";


export const Container =styled.div`

`
export const Headers=styled.div`
width: 260px;
height: 67px;
background: #7AC751;
display: flex;
align-items: center;
`
export const Logo=styled.img`
height:14px;
widht:18px;
`
export const Title =styled.div`
font-family: Rubik;
font-style: normal;
font-weight: 500;
font-size: 16px;
line-height: 19px;
letter-spacing: 0.02em;
color: #FFFFFF;
`
